import "./App.css";
import { Routes, Route } from "react-router-dom";
import JobF from "./Components/JobF/JobForm";
import Landing from "./Components/LandPage/Landing";
import CheckStatus from "./Components/Status/CheckStatus";
import Navbar from "./Components/Navbar/navbar";
import Foot from "./Components/Footer/footer"
import AddTechnician from "./Components/AddTechnician/AddTechnician";


function App() {
  return (
    <>
    <Navbar/>
     <div className="pt-[90px]"> 
    <Routes>
      {/* Default page */}
      <Route path="/" element={<Landing />} />


      {/* Job Form page */}
      <Route path="/jobform" element={<JobF />} />

      {/* Check Status page */}
      <Route path="/check-status" element={<CheckStatus />} />

      <Route path="/add-technician" element={<AddTechnician />} />


     </Routes>
     </div>
     <Foot/>
    </>
  );
}

export default App;
